Date.prototype.toRelativeTime=function(){var a=new Date-this;var b=null;var c={millisecond:1,second:1e3,minute:60,hour:60,day:24,month:30,year:12};for(var d in c){if(a<c[d]){break}else{b=d;a=a/c[d]}}a=Math.floor(a);if(a!==1){b+="s"}return[a,b,"ago"].join(" ")};Date.fromString=function(a){return new Date(Date.parse(a))}